import React from "react";
import styled from "styled-components";

const Wrapper = styled.section`
  position: absolute;
  width: 100%;
  height: 100%;
  left: 0;
  top: 0;
  display: flex;
  align-items: center;
  justify-content: center;
  & > .back {
    width: 100%;
    height: 100%;
    background-color: rgba(0, 0, 0, 0.5);
    position: absolute;
    left: 0;
    top: 0;
  }
  & > .box {
    position: relative;
    z-index: 200;
    width: 502px;
    height: 366px;
    border-radius: 13px;
    box-shadow: 0 3px 6px 0 rgba(0, 0, 0, 0.16);
    background-color: white;
  }
`;
function Popup() {
  return (
    <Wrapper>
      <div className="back" />
      <div className="box">
        <button>
          <figure>
            <img src="/assets/down/opacity-mail.svg" alt="" />
          </figure>
        </button>
      </div>
    </Wrapper>
  );
}

export default Popup;
